    "Computing Infrastructure and Remote, Parallel Data Mining Engine for Virtual Observatories
    Project",nt"tracking_summary": {ntt"total": 2,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-06T21:54:22.201569",nt"name":
    "computing-infrastructure-and-remote-parallel-data-mining-engine-for-virtual-observatories-",nt"isopen":
    true,nt"url": null,nt"notes": "SciberQuest, Inc. proposes to develop a
    state-of-the-art data mining engine that extends the functionality of Virtual Observatories
    (VO) from data portal to science analysis resource.  Our solution consists of two
    integrated products, IDDat and RemoteMiner:rnrn (1) IDDat is an advanced grid-based
    computing infrastructure which acts as an add-on to VOs and supports processing
    and remote data analysis of widely distributed data in space sciences.  IDDat middleware
    design is such as to reduce undue network traffic on the VO.rnrn(2)  RemoteMiner
    is a novel data mining engine that connects to the VO via the IDDat.  It supports
    multi-users, has autonomous operation for automated systematic identification while
    enabling the advanced users to do their own mining and can be used by data centers
    for pre-mining.  In addition, our data mining algorithms have reverse engineering
    capabilities which enable analytical derivation of models from time series data.rnrnrnThese
    innovations will significantly enhance the science return from NASA missions by
    providing data centers and individual researchers alike an unprecedented capability
    to mine vast quantities of data.  Phase II work will encompass the building of a
    full commercial product with associated production quality technical and user documentation.
